easystar.setGrid(collisionArray);
easystar.setAcceptableTiles([0]);

//===================== HELPER FUNCTIONS =========================
function sleep(time) {
    return new Promise((resolve) => setTimeout(resolve, time));
}

function randomInt(low, high) {
    return Math.floor(Math.random() * (high - low) + low);
}

function checkSameCoordinates(player, waypoint) {
    return ((player.x == waypoint.x) && (player.y == waypoint.y))
}


//====================== BOT FUNCTIONS ==========================
function doBotStuff(player, index, cycle = 0) {
    // TODO: Write a load model
    start = {};
    start.x = player.x;
    start.y = player.y;
    step = 3;
    // if even cycle (0/2): move left/right
    var dx = cycle % 2 == 0 ? cycle % 4 == 0 ? step : -step : 0;
    // if odd cycle (1/3): move up/down
    var dy = cycle % 2 == 1 ? cycle % 4 == 1 ? step : -step : 0;
    var delta = {x: dx, y: dy};
    pathfindingCallback = (path) => {if (path) BotClients[index].sendPath(path, {action: 0}, 0)};
    easystar.findPath(start.x, start.y, start.x + delta.x, start.y + delta.y, pathfindingCallback);
    easystar.calculate();
    setTimeout(() => doBotStuff({x: player.x + delta.x, y: player.y + delta.y}, index, (cycle + 1) % 4), 1500);
}

function wander(player, index) {
    let start = {x: player.x, y: player.y, queue: player.queue};
    let timeOfNextChoice = player.timeOfNextChoice;
    let chosenRandomWaypoint;

    let queue = [];
    if (player.queue) {
        queue = player.queue;
        // takes the last thing in the queue
        chosenRandomWaypoint = player.waypoint;
    }

    if (!chosenRandomWaypoint || timeOfNextChoice > Date.now() || checkSameCoordinates(player, chosenRandomWaypoint)) {
        chosenRandomWaypoint = questWaypoints[Math.floor(Math.random() * questWaypoints.length)];
        timeOfNextChoice = Date.now() + Math.random() * 10000;
    }

    let lastPathCell = {};

    pathfindingCallback = (path) => {
        if (queue.length > 0) {
            let dequeued = queue.shift();
            BotClients[index].sendPath(dequeued, {action: 0}, 0);
            lastPathCell = dequeued[dequeued.length - 1];
            pathQueue[index] = dequeued;
        } else if (path.length > 0 && path.length < 30) {
            BotClients[index].sendPath(path, {action: 0}, 0);
            lastPathCell = path[path.length - 1];
            pathQueue[index] = path;
        // if path to quest waypoint is too long, break into chunks
        } else if (path.length > 0) {
            let i,j, chunk = 5;
            for (i = 0, j = path.length; i < j; i += chunk) {
                queue.push(path.slice(i, i + chunk));
            }
            let dequeued = queue.shift();
            BotClients[index].sendPath(dequeued, {action: 0}, 0);
            lastPathCell = dequeued[dequeued.length - 1];
            pathQueue[index] = dequeued;
        } else if (path.length == 0) {
            lastPathCell = {x: chosenRandomWaypoint.x, y: chosenRandomWaypoint.y};
        }
    };
    easystar.findPath(start.x, start.y, chosenRandomWaypoint.x, chosenRandomWaypoint.y, pathfindingCallback);
    easystar.calculate();
    setTimeout(() => wander({x:lastPathCell.x, y: lastPathCell.y, timeOfNextChoice: timeOfNextChoice, queue: queue, waypoint: chosenRandomWaypoint}, index), 3000);
}

totalBots = 50;
for (var i = 0; i < totalBots; i++) {
    // BotClients.push(createBotClient(i, doBotStuff));
    BotClients.push(createBotClient(i, wander));
    BotClients[i].requestData();
}
